import Typewriter from "typewriter-effect";
import "./App.css";

function App() {
  return (
    <div>
      <Typewriter
        // options={{
        //   strings: ["coming", "soon"],
        //   autoStart: true,
        //   loop: true,
        //   deleteSpeed: 200,
        //   delay: 400,
        // }}
        onInit={(typewriter) => {
          typewriter
            .typeString("Hello World!")
            .callFunction(() => {
              console.log("String typed out!");
            })
            .pauseFor(2500)
            .deleteAll()

            .start();
        }}
      />
    </div>
  );
}

export default App;
